import React from 'react';
import { NavLink } from "react-router-dom";
import Recettes from './components/Recettes';
import Blog from './components/Blog';

const Menu = () => {
    return (
        <nav>
            <ul>
                <li>
                    <NavLink
                        to="messages"
                        style={({ isActive }) =>
                            isActive ? activeStyle : undefined
                        }
                    >
                        Messages
                    </NavLink>
                </li>
                <li>
                    <NavLink
                        to="tasks"
                        className={({ isActive }) =>
                            isActive ? activeClassName : undefined
                        }
                    >
                        Tasks
                    </NavLink>
                </li>
                <li>
                    <NavLink to="tasks">
                        {({ isActive }) => (
                            <span
                                className={
                                    isActive ? activeClassName : undefined
                                }
                            >
                                Tasks
                            </span>
                        )}
                    </NavLink>
                </li>
            </ul>
        </nav>
    );
};

export default Menu;
